        "fct-descr": "\u003cp\u003eMulti-line value display method\n\u003c/p\u003e\u003cp\u003eCreate a multiline displayable form of a value, returned\n  as a \u003ccode\u003e\u003ca\u003eShowS\u003c/a\u003e\u003c/code\u003e value.  The default implementation behaves just\n  like a normal instance of \u003ccode\u003e\u003ca\u003eShow\u003c/a\u003e\u003c/code\u003e.\n\u003c/p\u003e\u003cp\u003eThis function is intended to allow the calling function some control\n  of multiline displays by providing:\n\u003c/p\u003e\u003col\u003e\u003cli\u003e the first line of the value is not preceded by any text, so\n      it may be appended to some preceding text on the same line,\n\u003c/li\u003e\u003cli\u003e the supplied line break string is used to separate lines of the\n      formatted text, and may include any desired indentation, and\n\u003c/li\u003e\u003cli\u003e no newline is output following the final line of text.\n\u003c/li\u003e\u003c/ol\u003e",
