        "fct-descr": "\u003cp\u003eType for a datatype relation inference function.\n\u003c/p\u003e\u003cp\u003eA datatype relation defines tuples of values that satisfy some\n  relation.  A datatype relation inference function calculates\n  values that complete a relation with values supplied.\n\u003c/p\u003e\u003cp\u003eThe function accepts a list of \u003ccode\u003eMaybe vt\u003c/code\u003e, where vt is the\n  datatype value type.  It returns one of:\n\u003c/p\u003e\u003cul\u003e\u003cli\u003e Just a list of lists, where each inner list returned is a\n      complete set of values, including the values supplied, that\n      are in the relation.\n\u003c/li\u003e\u003cli\u003e Just an empty list is returned if the supplied values are\n      insufficient to compute any complete sets of values in the\n      relation.\n\u003c/li\u003e\u003cli\u003e Nothing if the supplied values are not consistent with\n      the relation.\n\u003c/li\u003e\u003c/ul\u003e",
