        "fct-descr": "\u003cp\u003eDatatypeVal is a structure that defines a number of functions\n  and values that characterize the behaviour of a datatype.\n\u003c/p\u003e\u003cp\u003eA datatype is specified with respect to (polymophic in) a given\n  type of (syntactic) expression with which it may be used, and\n  a value type (whose existence is hidden as an existential type\n  within \u003ccode\u003e\u003ca\u003eDatatypeMap\u003c/a\u003e\u003c/code\u003e).\n\u003c/p\u003e\u003cp\u003e(I tried hiding the value type with an internal existential\n  declaration, but that wouldn't wash.  Hence this two-part\n  structure with \u003ccode\u003e\u003ca\u003eDatatype\u003c/a\u003e\u003c/code\u003e in which the internal detail\n  of the value type is hidden from users of the \u003ccode\u003e\u003ca\u003eDatatype\u003c/a\u003e\u003c/code\u003e class.)\n\u003c/p\u003e\u003cp\u003eThe datatype characteristic functions have two goals:\n\u003c/p\u003e\u003col\u003e\u003cli\u003e to support the general datatype entailment rules defined by\n      the RDF semantics specification, and\n\u003c/li\u003e\u003cli\u003e to define additional datatype-specific inference patterns by\n      means of which provide additional base functionality to\n      applications based on RDF inference.\n\u003c/li\u003e\u003c/ol\u003e\u003cp\u003eDatatype-specific inferences are provided using the \u003ccode\u003e\u003ca\u003eDatatypeRel\u003c/a\u003e\u003c/code\u003e\n  structure for a datatype, which allows a number of named relations\n  to be defined on datatype values, and provides mechanisms to\n  calculate missing values in a partially-specified member of\n  a relation.\n\u003c/p\u003e\u003cp\u003eNote that rules and variable binding modifiers that deal with\n  combined values of more than one datatype may be defined\n  separately.  Definitions in this module are generally applicable\n  only when using a single datatype.\n\u003c/p\u003e\u003cp\u003eAn alternative model for datatype value calculations is inspired\n  by that introduced by CWM for arithmetic operations, e.g.\n\u003c/p\u003e\u003cpre\u003e     (1 2 3) math:sum ?x =\u003e ?x rdf:value 6\n\u003c/pre\u003e\u003cp\u003e(where the bare integer \u003ccode\u003en\u003c/code\u003e here is shorthand for \u003ccode\u003e\"n\"^^xsd:integer\u003c/code\u003e).\n\u003c/p\u003e\u003cp\u003eDatatype-specific inference patterns are provided in two ways:\n\u003c/p\u003e\u003cul\u003e\u003cli\u003e by variable binding modifiers that can be combined with the\n    query results during forward- for backward-chaining of\n    inference rules, and\n\u003c/li\u003e\u003cli\u003e by the definition of inference rulesets that involve\n    datatype values.\n\u003c/li\u003e\u003c/ul\u003e\u003cp\u003eI believe the first method to be more flexible than the second,\n  in that it more readily supports forward and backward chaining,\n  but can be used only through the definition of new rules.\n\u003c/p\u003e\u003cp\u003eType parameters:\n\u003c/p\u003e\u003cdl\u003e\u003cdt\u003e\u003ccode\u003eex\u003c/code\u003e\u003c/dt\u003e\u003cdd\u003e is the type of expression with which the datatype may be used.\n\u003c/dd\u003e\u003cdt\u003e\u003ccode\u003evt\u003c/code\u003e\u003c/dt\u003e\u003cdd\u003e is the internal value type with which the labels are associated.\n\u003c/dd\u003e\u003cdt\u003e\u003ccode\u003elb\u003c/code\u003e\u003c/dt\u003e\u003cdd\u003e is the type of label that may be used as a variable in an\n         expression or rule.\n\u003c/dd\u003e\u003cdt\u003e\u003ccode\u003evn\u003c/code\u003e\u003c/dt\u003e\u003cdd\u003e is the type of node that may be used to carry a value in an\n         expression or rule.\n\u003c/dd\u003e\u003c/dl\u003e",
        "fct-module": "Swish.Datatype",
        "fct-package": "swish",
        "fct-signature": "data",
