        "fct-descr": "\u003cp\u003e\u003ccode\u003e\u003ca\u003eApplyModifier\u003c/a\u003e\u003c/code\u003e function for use with \u003ccode\u003e\u003ca\u003eDatatypeMod\u003c/a\u003e\u003c/code\u003e in cases\n  when the value mapping is a \u003ccode\u003e1-\u003e1\u003c/code\u003e function and inverse, such\n  as negate.\n\u003c/p\u003e\u003cdl\u003e\u003cdt\u003e\u003ccode\u003enam\u003c/code\u003e\u003c/dt\u003e\u003cdd\u003e     is the name from the \u003ccode\u003e\u003ca\u003eDatatypeMod\u003c/a\u003e\u003c/code\u003e value that is carried into\n          the resulting variable binding modifier.\n\u003c/dd\u003e\u003cdt\u003e\u003ccode\u003efns\u003c/code\u003e\u003c/dt\u003e\u003cdd\u003e     are functions used to implement details of the variable\n          binding modifier:\n\u003c/dd\u003e\u003c/dl\u003e\u003col\u003e\u003cli\u003e is \u003ccode\u003e[x,y] -\u003e [?]\u003c/code\u003e, used as a filter (i.e. not creating any\n              new variable bindings), returning a non-empty list if \u003ccode\u003ex\u003c/code\u003e and \u003ccode\u003ey\u003c/code\u003e\n              are in the appropriate relationship.\n\u003c/li\u003e\u003cli\u003e is \u003ccode\u003e[y] -\u003e [x]\u003c/code\u003e, used to perform the calculation in a forward\n              direction.\n\u003c/li\u003e\u003cli\u003e is \u003ccode\u003e[x] -\u003e [y]\u003c/code\u003e, used to perform the calculation in a backward\n              direction.  This may be the same as (2) (e.g. for negation)\n              or may be different (e.g. increment).\n\u003c/li\u003e\u003c/ol\u003e\u003cdl\u003e\u003cdt\u003e\u003ccode\u003elbs\u003c/code\u003e\u003c/dt\u003e\u003cdd\u003e     is a list of specific label values for which a variable binding\n          modifier will be generated.  (The intent is that a variable-free\n          value can be generated as a Curried function, and instantiated\n          for particular variables as required.)\n\u003c/dd\u003e\u003c/dl\u003e\u003cp\u003eNote: an irrefutable pattern match for \u003ccode\u003elbs\u003c/code\u003e is used so that a name\n  for the \u003ccode\u003e\u003ca\u003eVarBindingModify\u003c/a\u003e\u003c/code\u003e value can be extracted using an undefined\n  label value.\n\u003c/p\u003e",
