    "cmd": "update",
    "document": {
      "uri": "http://hackage.haskell.org/package/swish/docs/Swish-GraphPartition.html#v:partitionGraph",
      "description": {
        "fct-descr": "\u003cp\u003eTurning a partitioned graph into a flat graph is easy.\n  The interesting challenge is to turn a flat graph into a\n  partitioned graph that is more useful for certain purposes.\n  Currently, I'm interested in:\n\u003c/p\u003e\u003col\u003e\u003cli\u003e isolating differences between graphs\n\u003c/li\u003e\u003cli\u003e pretty-printing graphs\n\u003c/li\u003e\u003c/ol\u003e\u003cp\u003eFor (1), the goal is to separate subgraphs that are known\n  to be equivalent from subgraphs that are known to be different,\n  such that: \n\u003c/p\u003e\u003cul\u003e\u003cli\u003e different sub-graphs are minimized,\n\u003c/li\u003e\u003cli\u003e different\n  sub-graphs are placed into 1:1 correspondence (possibly with null\n  subgraphs), and\n\u003c/li\u003e\u003cli\u003e only deterministic matching decisions are made.\n\u003c/li\u003e\u003c/ul\u003e\u003cp\u003eFor (2), the goal is to decide when a subgraph is to be treated\n  as nested in another partition, or treated as a new top-level partition.\n  If a subgraph is referenced by exactly one graph partition, it should\n  be nested in that partition, otherwise it should be a new top-level\n  partition.\n\u003c/p\u003e\u003cp\u003eStrategy.  Examining just subject and object nodes:\n\u003c/p\u003e\u003cul\u003e\u003cli\u003e all non-blank subject nodes are the root of a top-level partition\n\u003c/li\u003e\u003cli\u003e blank subject nodes that are not the object of exactly one statement\n     are the root of a top-level partition.\n\u003c/li\u003e\u003cli\u003e blank nodes referenced as the object of exactly 1 statement\n     of an existing partition are the root of a sub-partition of the\n     refering partition.\n\u003c/li\u003e\u003cli\u003e what remain are circular chains of blank nodes not referenced\n     elsewhere:  for each such chain, pick a root node arbitrarily.\n\u003c/li\u003e\u003c/ul\u003e",
        "fct-module": "Swish.GraphPartition",
        "fct-package": "swish",
        "fct-signature": "[Arc lb] -\u003e PartitionedGraph lb",
        "fct-source": "src/Swish-GraphPartition.html#partitionGraph",
        "fct-type": "function",
        "title": "partitionGraph"
      },
      "index": {
        "description": "Turning partitioned graph into flat graph is easy The interesting challenge is to turn flat graph into partitioned graph that is more useful for certain purposes Currently interested in isolating differences between graphs pretty-printing graphs For the goal is to separate subgraphs that are known to be equivalent from subgraphs that are known to be different such that different sub-graphs are minimized different sub-graphs are placed into correspondence possibly with null subgraphs and only deterministic matching decisions are made For the goal is to decide when subgraph is to be treated as nested in another partition or treated as new top-level partition If subgraph is referenced by exactly one graph partition it should be nested in that partition otherwise it should be new top-level partition Strategy Examining just subject and object nodes all non-blank subject nodes are the root of top-level partition blank subject nodes that are not the object of exactly one statement are the root of top-level partition blank nodes referenced as the object of exactly statement of an existing partition are the root of sub-partition of the refering partition what remain are circular chains of blank nodes not referenced elsewhere for each such chain pick root node arbitrarily",
        "hierarchy": "Swish GraphPartition",
        "module": "Swish.GraphPartition",
        "name": "partitionGraph",
        "normalized": "[Arc a]-\u003ePartitionedGraph a",
        "package": "swish",
        "partial": "Graph",
        "signature": "[Arc lb]-\u003ePartitionedGraph lb"
      }
    }
