        "fct-descr": "\u003cdiv class=\"doc\"\u003e\u003cp\u003eThis module defines functions for querying an RDF graph to obtain\n  a set of variable substitutions, and to apply a set of variable\n  substitutions to a query pattern to obtain a new graph.\n\u003c/p\u003e\u003cp\u003eIt also defines a few primitive graph access functions.\n\u003c/p\u003e\u003cp\u003eA minimal example is shown below, where we query a very simple\n  graph:\n\u003c/p\u003e\u003cpre class=\"screen\"\u003e\u003ccode class=\"prompt\"\u003e\u003e\u003e\u003e \u003c/code\u003e\u003cstrong class=\"userinput\"\u003e\u003ccode\u003e:m + Swish.RDF Swish.RDF.Parser.N3 Swish.RDF.Query\n\u003c/code\u003e\u003c/strong\u003e\u003ccode class=\"prompt\"\u003e\u003e\u003e\u003e \u003c/code\u003e\u003cstrong class=\"userinput\"\u003e\u003ccode\u003e:set -XOverloadedStrings\n\u003c/code\u003e\u003c/strong\u003e\u003ccode class=\"prompt\"\u003e\u003e\u003e\u003e \u003c/code\u003e\u003cstrong class=\"userinput\"\u003e\u003ccode\u003elet qparse = either error id . parseN3fromText\n\u003c/code\u003e\u003c/strong\u003e\u003ccode class=\"prompt\"\u003e\u003e\u003e\u003e \u003c/code\u003e\u003cstrong class=\"userinput\"\u003e\u003ccode\u003elet igr = qparse \"@prefix a: \u003chttp://example.com/\u003e. a:a a a:A ; a:foo a:bar. a:b a a:B ; a:foo a:bar.\"\n\u003c/code\u003e\u003c/strong\u003e\u003ccode class=\"prompt\"\u003e\u003e\u003e\u003e \u003c/code\u003e\u003cstrong class=\"userinput\"\u003e\u003ccode\u003elet qgr = qparse \"?node a ?type.\"\n\u003c/code\u003e\u003c/strong\u003e\u003ccode class=\"prompt\"\u003e\u003e\u003e\u003e \u003c/code\u003e\u003cstrong class=\"userinput\"\u003e\u003ccode\u003erdfQueryFind qgr igr\n\u003c/code\u003e\u003c/strong\u003e[[(?type,a:B),(?node,a:b)],[(?type,a:A),(?node,a:a)]]\n\u003ccode class=\"prompt\"\u003e\u003e\u003e\u003e \u003c/code\u003e\u003cstrong class=\"userinput\"\u003e\u003ccode\u003elet bn = (toRDFLabel . Data.Maybe.fromJust . Network.URI.parseURI) \"http://example.com/B\"\n\u003c/code\u003e\u003c/strong\u003e\u003ccode class=\"prompt\"\u003e\u003e\u003e\u003e \u003c/code\u003e\u003cstrong class=\"userinput\"\u003e\u003ccode\u003erdfFindArcs (rdfObjEq bn) igr\n\u003c/code\u003e\u003c/strong\u003e[(a:b,rdf:type,a:B)]\n\u003ccode class=\"prompt\"\u003e\u003e\u003e\u003e \u003c/code\u003e\u003cstrong class=\"userinput\"\u003e\u003ccode\u003eData.Maybe.mapMaybe (flip Swish.RDF.VarBinding.vbMap (Var \"type\")) $ rdfQueryFind qgr igr\n\u003c/code\u003e\u003c/strong\u003e[a:B,a:A]\n\u003c/pre\u003e\u003c/div\u003e",
        "fct-module": "Swish.RDF.Query",
        "fct-package": "swish",
