        "fct-descr": "\u003cp\u003eRepresent the language tag for a literal string, following\n RFC 3066 \u003ca\u003ehttp://www.ietf.org/rfc/rfc3066.txt\u003c/a\u003e.\n\u003c/p\u003e\u003cp\u003eUse \u003ccode\u003e\u003ca\u003etoLangTag\u003c/a\u003e\u003c/code\u003e to create a tag and \u003ccode\u003e\u003ca\u003efromLangTag\u003c/a\u003e\u003c/code\u003e to\n convert back. The case is preserved for the tag, although\n comparison (both the \u003ccode\u003e\u003ca\u003eEq\u003c/a\u003e\u003c/code\u003e instance and \u003ccode\u003ecompareLangTag\u003c/code\u003e)\n is done using the lower-case form of the tags.\n\u003c/p\u003e\u003cp\u003eAs an example:\n\u003c/p\u003e\u003cpre\u003e Prelude\u003e :set prompt \"swish\u003e \"\n swish\u003e :set -XOverloadedStrings\n swish\u003e :m + Swish.RDF.Vocabulary\n swish\u003e let en = \"en\" :: LanguageTag\n swish\u003e let us = \"en-us\" :: LanguageTag\n swish\u003e let gb = \"en-GB\" :: LanguageTag\n swish\u003e gb\n en-GB\n swish\u003e gb == \"en-gb\"\n True\n swish\u003e en == us\n False\n swish\u003e en `isBaseLang` us\n True\n swish\u003e us `isBaseLang` en\n False\n swish\u003e us `isBaseLang` gb\n False\n\u003c/pre\u003e",
