        "fct-descr": "\u003cdiv class=\"doc\"\u003e\u003cp\u003eSwish:  Semantic Web Inference Scripting in Haskell\n\u003c/p\u003e\u003cp\u003eThis program is a simple skeleton for constructing Semantic Web [1]\n  inference tools in Haskell, using the RDF graph and several RDF\n  parsers (at present Notation 3 and NTriples).\n\u003c/p\u003e\u003cp\u003eIt might be viewed as a kind of embroyonic CWM [2] in Haskell,\n  except that the intent is that Haskell will be used as a primary\n  language for defining inferences.  As such, Swish is an open-ended\n  toolkit for constructing new special-purpose Semantic Web\n  applications rather than a closed, self-contained general-purpose\n  SW application.  As such, it is part of another experiment along\n  the lines described in [3].\n\u003c/p\u003e\u003cp\u003eThe script format used by Swish is described in\n  \u003ca\u003eSwish.Script\u003c/a\u003e.\n\u003c/p\u003e\u003cp\u003eUsers wishing to process RDF data directly may prefer to look at\n  the following modules; \u003ca\u003eSwish.RDF\u003c/a\u003e, \u003ca\u003eSwish.RDF.Parser.Turtle\u003c/a\u003e,\n  \u003ca\u003eSwish.RDF.Parser.N3\u003c/a\u003e, \u003ca\u003eSwish.RDF.Parser.NTriples\u003c/a\u003e,\n  \u003ca\u003eSwish.RDF.Formatter.Turtle\u003c/a\u003e, \u003ca\u003eSwish.RDF.Formatter.N3\u003c/a\u003e\n  and \u003ca\u003eSwish.RDF.Formatter.NTriples\u003c/a\u003e.\n\u003c/p\u003e\u003col\u003e\u003cli\u003e Semantic web: \u003ca\u003ehttp://www.w3.org/2001/sw/\u003c/a\u003e\n\u003c/li\u003e\u003cli\u003e CWM:          \u003ca\u003ehttp://www.w3.org/2000/10/swap/doc/cwm.html\u003c/a\u003e\n\u003c/li\u003e\u003cli\u003e Motivation:   \u003ca\u003ehttp://www.w3.org/2000/10/swap/doc/Motivation.html\u003c/a\u003e\n\u003c/li\u003e\u003cli\u003e Notation 3:   \u003ca\u003ehttp://www.w3.org/TeamSubmission/2008/SUBM-n3-20080114/\u003c/a\u003e\n\u003c/li\u003e\u003cli\u003e Turtle:       \u003ca\u003ehttp://www.w3.org/TR/turtle/\u003c/a\u003e\n\u003c/li\u003e\u003cli\u003e RDF:          \u003ca\u003ehttp://www.w3.org/RDF/\u003c/a\u003e\n\u003c/li\u003e\u003c/ol\u003e\u003cp\u003eNotes\n\u003c/p\u003e\u003cp\u003eI anticipate that this module may be used as a starting point for\n  creating new programs rather then as a complete program in its own\n  right.  The functionality built into this code is selected with a\n  view to testing the Haskell modules for handling RDF rather than\n  for performing any particular application processing (though\n  development as a tool with some broader utility is not ruled out).\n\u003c/p\u003e\u003cp\u003eWith the following in ghci:\n\u003c/p\u003e\u003cpre class=\"screen\"\u003e\u003ccode class=\"prompt\"\u003e\u003e\u003e\u003e \u003c/code\u003e\u003cstrong class=\"userinput\"\u003e\u003ccode\u003e:m + Swish\n\u003c/code\u003e\u003c/strong\u003e\u003ccode class=\"prompt\"\u003e\u003e\u003e\u003e \u003c/code\u003e\u003cstrong class=\"userinput\"\u003e\u003ccode\u003e:set prompt \"swish\u003e \"\n\u003c/code\u003e\u003c/strong\u003e\u003c/pre\u003e\u003cp\u003ethen we can run a Swish script (format described in \u003ca\u003eSwish.Script\u003c/a\u003e)\n by saying:\n\u003c/p\u003e\u003cpre class=\"screen\"\u003e\u003ccode class=\"prompt\"\u003e\u003e\u003e\u003e \u003c/code\u003e\u003cstrong class=\"userinput\"\u003e\u003ccode\u003erunSwish \"-s=script.ss\"\n\u003c/code\u003e\u003c/strong\u003eExitSuccess\n\u003c/pre\u003e\u003cp\u003eor convert a file from Turtle to NTriples format with:\n\u003c/p\u003e\u003cpre class=\"screen\"\u003e\u003ccode class=\"prompt\"\u003e\u003e\u003e\u003e \u003c/code\u003e\u003cstrong class=\"userinput\"\u003e\u003ccode\u003erunSwish \"-ttl -i=foo.ttl -nt -o=foo.nt\"\n\u003c/code\u003e\u003c/strong\u003eExitSuccess\n\u003c/pre\u003e\u003cp\u003eYou can also use \u003ccode\u003e\u003ca\u003evalidateCommands\u003c/a\u003e\u003c/code\u003e by giving it the individual commands,\n such as\n\u003c/p\u003e\u003cpre class=\"screen\"\u003e\u003ccode class=\"prompt\"\u003e\u003e\u003e\u003e \u003c/code\u003e\u003cstrong class=\"userinput\"\u003e\u003ccode\u003elet Right cs = validateCommands [\"-ttl\", \"-i=file1.ttl\", \"-c=file2.ttl\"]\n\u003c/code\u003e\u003c/strong\u003e\u003ccode class=\"prompt\"\u003e\u003e\u003e\u003e \u003c/code\u003e\u003cstrong class=\"userinput\"\u003e\u003ccode\u003ecs\n\u003c/code\u003e\u003c/strong\u003e[SwishAction: -ttl,SwishAction: -i=file1.ttl,SwishAction: -c=file2.ttl]\n\u003ccode class=\"prompt\"\u003e\u003e\u003e\u003e \u003c/code\u003e\u003cstrong class=\"userinput\"\u003e\u003ccode\u003est \u003c- runSwishActions cs\n\u003c/code\u003e\u003c/strong\u003e\u003ccode class=\"prompt\"\u003e\u003e\u003e\u003e \u003c/code\u003e\u003cstrong class=\"userinput\"\u003e\u003ccode\u003est\n\u003c/code\u003e\u003c/strong\u003eThe graphs do not compare as equal.\n\u003c/pre\u003e\u003c/div\u003e",
